import React, { useState } from "react";
import axios from "axios";
import styles from "../App.module.css";
import Link from "react-router-dom";

function Login() {
	const [username, usernameupdate]= useState("");
	const [password, passwordupdate]=useState("");

	const ProceedLogin=(e)=>{
		e.preventDefault();
	}

	return (
		<div className={styles.login}>
		<form onSubmit={ProceedLogin} className={styles.loginform}>
		<div className={styles.loginformheader}>
		<h2>User Login</h2>
		</div>
		<div className={styles.formloginbody}>
		<div className={styles.loginformgroup}>
		<label>User Name <span className={styles.loginerrormessage}>*</span></label>
		<input className={styles.loginformcontrol}></input>
		</div>
		<div className={styles.loginformgroup}>
		<label>Password <span className={styles.loginerrormessage}>*</span></label>
		<input className={styles.loginformcontrol}></input>
		</div>
		<div className={styles.loginformfooter}>
		<button className={styles.btn} type="submit"></button>
		<Link className={styles.btn} to={"/login"}>Sign In</Link>
		</div>

		</div>
		</form>
		</div>
	);
}

export default Login;
